import React, {Routerbrowser as Router, Switch, Route}from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
    </div>
  );
}



const Header = () => {
  return(
  <Router>
    <Switch>
      <Route path='Home'> <Home /> </Route>
      <Route path='Product'> <Product /> </Route>
      <Route path='About'> <About /> </Route>
    </Switch>
  </Router>
  )
}

const Home = () => <div>Home</div>
const Product = () => <div>Product</div>
const About = () => <div>About</div>

export default App;
